    <link rel=\"stylesheet\" href=\"https://stackpath.bootstrapcdn.com/bootstrap/4.5.0/css/bootstrap.min.css\" integrity=\"sha384-9aIt2nRpC12Uk9gS9baDl411NQApFmC26EwAOH8WgZl5MYYxFfc+NcPb1dKGj7Sk\" crossorigin=\"anonymous\">
    {% block stylesheets %}{% endblock %}
    <title>
        {% block title %}VideoProj - Videos hosting and sharing service{% endblock %}
    </title>
</head>
<body>
{% block menu %}
<nav class=\"navbar navbar-expand-lg navbar-dark bg-dark fixed-top\">
    <div class=\"text-left float-left\">
        <a class=\"navbar-brand\" href=\"{{ path('home') }}\">
            <svg width=\"1em\" height=\"1em\" viewBox=\"0 0 16 16\" class=\"bi bi-camera-video-fill\" fill=\"currentColor\" xmlns=\"http://www.w3.org/2000/svg\">
                <path d=\"M2.667 3h6.666C10.253 3 11 3.746 11 4.667v6.666c0 .92-.746 1.667-1.667 1.667H2.667C1.747 13 1 12.254 1 11.333V4.667C1 3.747 1.746 3 2.667 3z\"/>
                <path d=\"M7.404 8.697l6.363 3.692c.54.313 1.233-.066 1.233-.697V4.308c0-.63-.693-1.01-1.233-.696L7.404 7.304a.802.802 0 0 0 0 1.393z\"/>
            </svg>
            VideoProj
        </a>
    </div>
        <form method=\"GET\" class=\"form-inline my-0 mr-md-auto\" action=\"{{ path('search')}}\">
            <input name=\"query\" class=\"form-control mr-sm-2\" type=\"search\" placeholder=\"video title\" aria-label=\"Search video\">
            <button class=\"btn btn-outline-violet-light my-2 my-sm-0\" type=\"submit\">Search video</button>
        </form>
        <button class=\"navbar-toggler\" type=\"button\" data-toggle=\"collapse\" data-target=\"#navbarResponsive\" aria-controls=\"navbarResponsive\" aria-expanded=\"false\" aria-label=\"Toggle navigation\">
            <span class=\"navbar-toggler-icon\"></span>
        </button>

    <div class=\"container\">

        <div class=\"collapse navbar-collapse\" id=\"navbarResponsive\">
            <ul class=\"navbar-nav ml-auto\">
                {{ render(controller(\"App\\\\Controller\\\\FrontController::categoriesList\", { 'id': app.request.get('id') })) }}
                {% if app.user %}
                        <li class=\"nav-link admin\">
                            <a href=\"{{ path('admin_profile')}}\">@{{ app.user.name }}
                            </a>
                        </li>
                    <li class=\"nav-link admin\">
                        <a href=\"{{ path('logout')}}\"> Logout
                        </a>
                    </li>
                {% else %}
                        <li class=\"nav-link admin\">
                            <a href=\"{{ path('pricing')}}\">Sign up</a>
                        </li>
                        <li class=\"nav-link admin\" >
                            <a href=\"{{ path('login')}}\">Sign in</a>
                        </li>
                {% endif %}
            </ul>
        </div>
